import React from 'react';
import { makeStyles } from '@material-ui/core/styles';
import Icon from '@material-ui/core/Icon';
import Input from '@material-ui/core/Input';
import InputLabel from '@material-ui/core/InputLabel';
import InputAdornment from '@material-ui/core/InputAdornment';
import FormControl from '@material-ui/core/FormControl';


const useStyles = makeStyles((theme) => ({
    root: {
        '& > *': {
            margin: theme.spacing(1),
            width: '25ch',
        },
    },
    margin: {
        margin: theme.spacing(1),
    },
    paddingtop: {
        padding: '16px 0 8px'
    }
}));

export default function GoesEmpresas() {
    const classes = useStyles();
    return (
        <form className={classes.root} noValidate autoComplete="off">
           <FormControl fullWidth className={classes.paddingtop}>
                <InputLabel htmlFor="standard-adornment-amount"
                > <Icon className="text-60" color="action">sentiment_dissatisfied</Icon>
                Que problema esta solucionando el Productos/Servicios que ofrece tu empresa</InputLabel>
                <Input
                    id="standard-adornment-amount"
                    className="mt-8 mb-16"
                    multiline
                    rowsMax={5}
                    variant="outlined"
                    fullWidth
                    endAdornment={<InputAdornment position="end">  <Icon className="text-30" color="action">
                        help_outline
						</Icon></InputAdornment>}
                />
            </FormControl>
            <FormControl fullWidth className={classes.margin}>
                <InputLabel htmlFor="standard-adornment-amount"
                > <Icon className="text-60" color="action">wc</Icon> Describe los segmentos de clientes que accederan a tus
               Productos/Servicios</InputLabel>
                <Input
                    id="standard-adornment-amount"
                    className="mt-8 mb-16"
                    multiline
                    rowsMax={5}
                    variant="outlined"
                    fullWidth
                    endAdornment={<InputAdornment position="end">  <Icon className="text-30" color="action">
                        help_outline
						</Icon></InputAdornment>}
                />
            </FormControl>
            <FormControl fullWidth className={classes.margin}>
                <InputLabel htmlFor="standard-adornment-amount"
                > <Icon className="text-60" color="action">favorite</Icon> Piensa y describe la propuesta de valor que entrega a tu cliente ideal</InputLabel>
                <Input
                    id="standard-adornment-amount"
                    className="mt-8 mb-16"
                    multiline
                    rowsMax={5}
                    variant="outlined"
                    fullWidth
                    endAdornment={<InputAdornment position="end">  <Icon className="text-30" color="action">
                        help_outline
						</Icon></InputAdornment>}
                />
            </FormControl>
            
            <FormControl fullWidth className={classes.margin}>
                <InputLabel htmlFor="standard-adornment-amount"
                > <Icon className="text-60" color="action">chat</Icon> ¿Cuales son los vanales de atencion que la empresa dispone para sus clientes?</InputLabel>
                <Input
                    id="standard-adornment-amount"
                    className="mt-8 mb-16"
                    multiline
                    rowsMax={5}
                    variant="outlined"
                    fullWidth
                    endAdornment={<InputAdornment position="end">  <Icon className="text-30" color="action">
                        help_outline
						</Icon></InputAdornment>}
                />
            </FormControl>

            <FormControl fullWidth className={classes.margin}>
                <InputLabel htmlFor="standard-adornment-amount"
                > <Icon className="text-60" color="action">monetization_on</Icon>¿Cuales seran las fuentes de ingresos?</InputLabel>
                <Input
                    id="standard-adornment-amount"
                    className="mt-8 mb-16"
                    multiline
                    rowsMax={5}
                    variant="outlined"
                    fullWidth
                    endAdornment={<InputAdornment position="end">  <Icon className="text-30" color="action">
                        help_outline
						</Icon></InputAdornment>}
                />
            </FormControl>
            <FormControl fullWidth className={classes.margin}>
                <InputLabel htmlFor="standard-adornment-amount"
                > <Icon className="text-60" color="action">local_atm</Icon> ¿Cuales seran los gastos fijos que necesitaras para que la empresa y productos funciones?</InputLabel>
                <Input
                    id="standard-adornment-amount"
                    className="mt-8 mb-16"
                    multiline
                    rowsMax={5}
                    variant="outlined"
                    fullWidth
                    endAdornment={<InputAdornment position="end">  <Icon className="text-30" color="action">
                        help_outline
						</Icon></InputAdornment>}
                />
            </FormControl> 
        </form>
    );
}
